import React, { useContext } from 'react';
import { BrowserRouter as Router, Route, Routes, useNavigate } from 'react-router-dom'; // Import Routes, Route from v6
import AuthContext from './context/AuthContext';  // Import AuthContext
import ProtectedRoute from './components/ProtectedRoute.js';  // Import ProtectedRoute
import Login from './components/Login.js';  // Login Page
import Register from './components/Register.js';  // Register Page
import Dashboard from './pages/Dashboard.js';  // Protected Page
import AdminPanel from './pages/AdminPanel.js';  // Admin-only page (if needed)

function App() {
  const { user } = useContext(AuthContext);  // Get the user from AuthContext

  return (
    <Router>
      <Routes>
        {/* Public Routes */}
        <Route path="/" element={<Login />} />
        <Route path="/register" element={<Register />} />

        {/* Protected Routes */}
        <Route
          path="/dashboard"
          element={<ProtectedRoute component={Dashboard} />}
        />
        <Route
          path="/admin"
          element={<ProtectedRoute component={AdminPanel} />}
        />
      </Routes>
    </Router>
  );
}

export default App;
